package com.example.baithibe23_11.controller;

import com.example.baithibe23_11.model.Place;
import org.springframework.http.ResponseEntity;
import org.springframework.web.bind.annotation.*;

import java.util.List;

@RestController
@RequestMapping("/api/places")
@CrossOrigin(origins = "http://localhost:64234") // Cho phép Flutter kết nối
public class PlaceController {

    @GetMapping("/getAllPlace")
    public ResponseEntity<List<Place>> getAllPlace() {
        List<Place> places = List.of(
               // em lấy dữ liệu luôn cho nhanh ạ
                new Place(1,"Sai Gon","hdf","data:image/jpeg;base64,"),
                new Place(2, "New York", "City that never sleeps", "data:image/jpeg;base64,"),
                new Place(4,"Ha Noi", "famous for its classical architecture and rich culture","data:image/jpeg;base64,"),
                new Place(3, "Tokyo", "Vibrant city in Japan", "https://media.istockphoto.com/id/669545870/vi/anh/th%C3%A1p-tokyo-nh%E1%BA%ADt-b%E1%BA%A3n-%C4%91%C6%B0%E1%BB%9Dng-ch%C3%A2n-tr%E1%BB%9Di-th%C3%A0nh-ph%E1%BB%91-tokyo-v%C3%A0-c%E1%BA%A3nh-quan-th%C3%A0nh-ph%E1%BB%91.jpg?s=612x612&w=0&k=20&c=C9WnyWXhSQNMraDfmmKb1EUBqyDoltwf_RCXyWs5bfY=")
        );
        return ResponseEntity.ok(places);
    }
}